import '../../Styles/Product.css';

export default function ProductQuickView(props) {

    return(
        <div>
            {
                props.view === true &&
                <div className='ProductQuickView'
                    onClick={props.closeView}>
                    <div 
                        className="productquickview-container"
                        onClick={()=>{}}
                    >
                        <div className="productquickview-slide">
                            <img>
                                props.urlImage
                            </img>
                        </div>
                    </div>
                </div>
            }
        </div>
    )
}
